import React, { useEffect } from 'react';
import { View, StyleSheet, TouchableOpacity, Text } from 'react-native';
import { useIsFocused } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import { createStackNavigator } from '@react-navigation/stack';
import { SHCss } from "../Common/SHCss";
import Theme from '../constants/Theme';

const Stack = createStackNavigator();

const PunisComponent = (props) => {
    const isFocused = useIsFocused();
    useEffect(() => {
        if (isFocused) {

        }
    }, [props, isFocused])
    return (
        <View style={[SHCss.container]}>
            <Text>Tính năng đang phát triển!</Text>
        </View>
    )
}

const Punis = (props) => {
    return (
        <Stack.Navigator initialRouteName="Punis">
            <Stack.Screen
                name="PunisComponent"
                component={PunisComponent}
                options={{
                    headerLeft: () => (
                        <TouchableOpacity style={{ marginHorizontal: 10 }} onPress={() => props.navigation.openDrawer()}>
                            <Ionicons name="ios-menu" size={30} color="white" />
                        </TouchableOpacity>
                    ),
                    title: 'Bắt lỗi 360',
                    headerStyle: {
                        backgroundColor: Theme.COLORS.GREEN_PORTAL,
                        minHeight: 70
                    },
                    headerTitleAlign: 'center',
                    headerTintColor: '#fff',
                    headerTitleStyle: {
                        fontWeight: 'bold',
                    },
                }} />
        </Stack.Navigator>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: "column",
    },
    image: {
        flex: 1,
        flexDirection: 'column',
        resizeMode: "cover",
    },
    text: {
        color: "white",
        fontSize: 42,
        fontWeight: "bold",
        textAlign: "center",
        backgroundColor: "#000000a0"
    },
})

export default Punis;
